import ItemCardContent from '../components/ItemCardContent'


const Sativa = (props) => (
    <Layout>
        <>
        <h1>Sativa</h1>
        <ItemCardContent  />

            <style jsx>
                {
                    `
                    h1 {
                        text-align: center;
                        text-decoration: underline;
                    }
                    `
                }
            </style>
        </>
    </Layout>

);


export default Sativa;
